import React from 'react';
import { Container, Header, Grid, Image, List, Segment } from 'semantic-ui-react';
import PropTypes from 'prop-types';
import vk from '../../../Images/vk.png';

const HomepageHeading = ({ bool }) => {
  console.log("this is what =" + bool)
  return (
    <Container style={{ width: '100%' }}>
      <Segment inverted vertical style={{ padding: '1px', margin: '0px' }}>
        <Grid inverted stackable>
          <Grid.Row>
            <Grid.Column width={16} style={{padding:"10px"}}>
              <div  style={{ minHeight: 300 }} className="custom_movieContentHeader">
                <Header
                  as='h2'
                  content='Imagine-a-Company'
                  inverted
                  style={{
                    fontSize: bool ? '1.5em' : '2em',
                    fontWeight: 'normal',
                    marginBottom: 0,
                    marginTop: bool ? '1em' : '1em',
                  }}
                />
              </div>

            </Grid.Column>
            {/* <Grid.Column width={11}>
              <Image src={vk} />
            </Grid.Column> */}
          </Grid.Row>
        </Grid>
      </Segment>
    </Container>
  )
}

HomepageHeading.propTypes = {
  mobile: PropTypes.bool
}

export default HomepageHeading;
